* {
	font-family: inherit;
	color: inherit;
	font-size: inherit;
	box-sizing: border-box;
}

body {
	background-color: #eeeeee;
	/* background: url('../img/panorama-2559103_1920.jpg') no-repeat center 80% fixed; */
	background: url('../img/vidbg.png') no-repeat center center fixed;
	-webkit-background-size: cover;
	-moz-background-size: cover;
	-o-background-size: cover;
	background-size: cover;
	background-attachment: fixed;
	color: #111111;
}
body,
html {
	font-family: 'Barlow', sans-serif;
	font-size: 90%;
	line-height: 1.8;
	font-weight: 300;
}

h1,
h2,
h3,
h4,
h5,
h6 {
	letter-spacing: -0.015em;
}

h1 {
	font-weight: 800;
	font-size: 3em;
}

h2 {
	font-weight: 800;
	font-size: 2em;
}

b {
	font-weight: 600;
}

img {
	user-drag: none;
	user-select: none;
	-moz-user-select: none;
	-webkit-user-drag: none;
	-webkit-user-select: none;
	-ms-user-select: none;
}

img {
	max-width: 100%;
	display: block;
}

p {
	margin-bottom: 1.3em;
	display: block;
}

a {
	color: #005896;
	transition: 0.15s all linear;
	line-height: 1.8;
	text-decoration: none;
}

a:hover {
	color: #db8000;
}

ul.list li {
	margin-bottom: 0.5em;
}
ul.list li:before {
	content: '\0025ba\00a0';
	font-size: 0.75em;
	margin-right: 0.5em;
}

iframe.yt {
	width: 100%;
	height: 100%;
}

.hero {
	display: flex;
	align-items: center;
	justify-content: center;
	flex-direction: row;

	background-color: rgba(0, 88, 150, 0.61);
	min-height: 100vh;
	position: relative;
	color: #ffffff;
}

.hero .bgoverlay {
	position: absolute;
	top: 0;
	left: 0;
	height: 100%;
	width: 50%;
}

.hero .bgvid_container {
	position: absolute;
	top: 0;
	bottom: 0;
	width: 100%;
	height: 100%;
	overflow: hidden;
	z-index: -2;
}

.hero .bgvid {
	/* Make video to at least 100% wide and tall */
	min-width: 100%;
	min-height: 100%;

	/* Setting width & height to auto prevents the browser from stretching or squishing the video */
	width: auto;
	height: auto;

	/* Center the video */
	position: fixed;
	top: 50%;
	left: 50%;
	transform: translate(-50%, -50%);
}

.hero img.logo {
	max-width: 15em;
	box-sizing: border-box;
	width: 100%;
}

.hero .flexhalf {
	width: 50%;
	z-index: 1;
	display: flex;
	justify-content: center;
	align-items: center;
	flex-direction: column;
	padding: 2em;
}

.flexhalf p {
	text-align: left;
}

.hero .tagline_wrapper {
	max-width: 45em;
	text-align: center;
	font-size: 0.85em;
}

.hero .tagline {
	font-size: 4.5em;
	font-weight: 300;
	display: inline-block;
	text-align: left;
}

.logo_left {
	margin: 2em 1em 2em 2em;
	display: flex;
	align-items: center;
	justify-content: center;
	flex-direction: column;
}

.tagline_right {
	margin: 2em 0em 2em 1em;
	display: flex;
	align-items: flex-end;
	justify-content: center;
	flex-direction: column;
	text-align: right;
	max-width: 55%;
}

.fright h1 {
	display: block;
}

.hero p {
	font-size: 1.6em;
}

.hero_old {
	background-color: rgba(0, 88, 150, 0.61);
	min-height: 100vh;
	position: relative;
	color: #ffffff;
}

.hero_old .bgvid_container {
	position: absolute;
	top: 0;
	bottom: 0;
	width: 100%;
	height: 100%;
	overflow: hidden;
	z-index: -1;
}

.hero_old .bgvid {
	/* Make video to at least 100% wide and tall */
	min-width: 100%;
	min-height: 100%;

	/* Setting width & height to auto prevents the browser from stretching or squishing the video */
	width: auto;
	height: auto;

	/* Center the video */
	position: fixed;
	top: 50%;
	left: 50%;
	transform: translate(-50%, -50%);
}

.hero_old > .tagline_wrap {
	position: absolute;
	left: 0;
	bottom: 0;
	width: 100%;
}

.hero_old .tagline h1 {
	font-size: 5em;
	font-weight: 300;
	display: inline-block;
}

.hero_old .tagline p {
	font-size: 1.6em;
	font-weight: 400;
	max-width: 66%;
}

