.box i.main {
	max-width: 100%;
	font-size: 3.6em;
	margin: 0 auto;
	margin-top: 0.5em;
	margin-bottom: 0.5em;
}

.box .title {
	font-size: 1.5em;
	margin-top: 0.5em;
	margin-bottom: 0.75em;
}

.row.cardrow {
	flex-wrap: nowrap;
	overflow-x: scroll;
	position: relative;
	padding-bottom: 25px;
}

.row.cardrow::-webkit-scrollbar {
	height: 25px;
	cursor: pointer;
}

.row.cardrow::-webkit-scrollbar-track {
	background: rgba(0, 0, 0, 0.2);
	border-radius: 100px;
	border: 10px solid #005896;
	height: 15px;
	margin: 6em;
}

.row.cardrow::-webkit-scrollbar-thumb {
	background: #0074c5;
	width: 25px;
	border-radius: 100px;
	transition: 0.15s all linear;
}

.row.cardrow::-webkit-scrollbar-thumb:hover {
	background: #004779;
}

