.card {
	flex: 0 0 auto;
	width: 25em;
	font-size: 1.2em;
	margin: 1%;
	float: left;
	text-align: center;
	background-color: #eeeeee;
	color: #111111;
	box-shadow: 0px 4px 15px 0px rgba(0, 0, 0, 0.5);
	position: relative;
}

.card.offset {
	flex: 0 0 auto;
	width: 3em;
	font-size: 1.2em;
	margin: 1%;
	float: left;
	text-align: center;
	background-color: transparent;
	color: #111111;
	box-shadow: none;
	position: relative;
}

.card img {
	width: 100%;
	max-width: 100%;
	display: block;
}

.card h1.title {
	font-size: 1.75em;
}

.card p.bold {
	font-weight: 800;
	color: #005896;
}
.card .rmore {
	margin-top: 2em;
	display: inline-block;
}

.card .rmore:after {
	position: absolute;
	content: 'More Info >>';
	bottom: 0;
	right: 0;
	padding: 1.2em;
}

.card .description {
	padding: 1em;
	padding-left: 5%;
	padding-right: 5%;
}

form {
	max-width: 65em;
	margin: 0 auto;
	margin-top: 3em;
}

input,
textarea {
	margin: 0.5em;
	width: 30%;
	padding: 1em;
	color: #000000;
	border-radius: 3px;
	border: 1px solid #cfcfcf;
}

.flex-outer li,
.flex-inner {
	display: flex;
	flex-wrap: wrap;
	align-items: center;
}

.flex-outer > li > label,
.flex-outer li p {
	flex: 1 0 4em;
	max-width: 12em;
	text-align: right;
	padding-right: 2em;
}

.flex-outer > li > label + *,
.flex-inner {
	flex: 1 0 4em;
}

.flex-outer li input[type='submit'] {
	margin-left: auto;
	padding: 1em;
	border: none;
	background: #ffffff;
	color: #000000;
	border-radius: 2px;
	cursor: pointer;
	transition: 0.15s all linear;
}

.flex-outer li input[type='submit']:hover {
	color: #005896;
	background-color: #ddddff;
}

.footer {
	color: #52b7ff;

	margin-left: 3em;
	margin-right: 3em;
}

.social {
	margin: 0 0.4em 0 0.4em;
}

.largefont {
	font-size: 1.5em;
}

.clearfix {
	clear: both;
}

/*	MODAL	*/

.modal {
	display: flex;
	display: none;
	justify-content: center;
	align-items: center;
	position: fixed;
	left: 0;
	right: 0;
	top: 0;
	bottom: 0;
	overflow: auto;
	background-color: rgba(0, 0, 0, 0.5);
	z-index: 1000;
}

.modal.hidden {
	display: none;
}

.modal .lightbox {
	position: relative;
	background-color: #eeeeee;
	max-width: 64em;
	max-height: 36em;
	width: 100%;
	height: 100%;
	box-shadow: 0px 0px 55px 3px rgba(0, 0, 0, 0.3);
}

.modal .lightbox .close {
	position: absolute;
	z-index: 1;
	width: 2.7em;
	height: 2.7em;
	background-color: #eeeeee;
	top: 0;
	right: 0;
	display: flex;
	justify-content: center;
	align-items: center;
	vertical-align: middle;
	cursor: pointer;
	user-select: none;
	color: #aaaaaa;
	transition: 0.15s all linear;
}

.modal .lightbox .close:hover {
	color: #888888;
}

.lightbox .content {
	width: 100%;
	height: 100%;
}

.lightbox_insertable_content {
	display: none;
}

.flex-center {
	display: flex;
	justify-content: center;
	align-items: center;
	flex-direction: column;
}

.map_wrapper {
	width: 100%;
	min-height: 40em;
	height: 40em;
	position: relative;
}

.map_wrapper iframe {
	width: 100%;
	height: 100%;
}

.yt_thumb {
	margin: 0.5em 0 0.5em 0;
}

#mailResponse {
	font-weight: 700;
	float: right;
	margin: 1em 1em 1em 0;
}

@media screen and (max-width: 1100px) {
	.row {
		flex-direction: column;
	}

	.row.cardrow {
		flex-direction: row;
	}

	.box {
		float: none;
		width: 100% !important;
		padding-left: 10%;
		padding-right: 10%;
	}

	.card {
		font-size: 0.9em;
	}

	form {
		width: 100%;
		max-width: 100%;
	}

	.flex-outer > li > label,
	.flex-outer li p {
		flex: 1 0 4em;
		max-width: 8em;
		text-align: right;
		padding-right: 2em;
	}
}

@media screen and (max-width: 850px) {
	.hero .tagline_wrapper {
		justify-content: center;
		flex-direction: column;
	}

	.hero .tagline_right {
		align-items: center;
		max-width: 100%;
		text-align: left;
	}

	.contentwidth.flexrow {
		display: block;
	}

	.hero .flexhalf {
		width: auto;
	}
}

@media screen and (max-width: 500px) {
	.hero .tagline_wrapper .tagline {
		font-size: 3.5em;
	}

	.hero p {
		font-size: 1.2em;
	}

	.hero img.logo {
		max-width: 10em;
		box-sizing: border-box;
		width: 100%;
	}
}
